css:
.auto-cursor {
  cursor: default;
}
kite-logo {
  display: inline-block;
}
kite-logo svg {
  display: inline-block;
  vertical-align: middle;
}
kite-logo.badge {
  background: rgba(33, 37, 43, 0.8);
  font-size: 8px;
  line-height: 14px;
  padding: 0 3px;
  border-radius: 3px;
  box-sizing: border-box;
  width: 16px;
  height: 16px;
  margin: -2px;
  margin-left: 10px;
}
kite-logo.badge svg polygon {
  fill: rgba(157, 165, 180, 0.6);
}
